import { set } from "date-fns";
import { useState } from "react";

export const Form = () => {
  const [email, setEmail] = useState("");

  const handleEmail = (event) => {
    setEmail(event.target.value);
  };
  return (
    <form>
      <input type="text" onChange={handleEmail} />
      <button>Sign Up</button>
    </form>
  );
};
